function Itemanh(props) {
  const { picturearray } = props;
  return picturearray.map((array) => (
    <div key={array.id} className="slide-tintuc">
      <a href="true">
        <img src={array.Img} alt="true" />
      </a>
    </div>
  ));
}
export default Itemanh;
